@import url('https://fonts.googleapis.com/css2?family=Geom:ital,wght@0,300..900;1,300..900&display=swap');
:root { --accent: 133, 100, 255; --backdropBlur: blur(0px); --detailGradient: linear-gradient(54deg, rgba(var(--tint),1) 0%, rgba(var(--tint),0.7) 100%); --loginGradient: linear-gradient(180deg, rgba(var(--tint),1) 0%, rgba(var(--tint),0.7) 100%); --tint: 17,14,30; --tint2: 71,51,145; --rounding: 0.8em; }
body { font-family: 'Geom', sans-serif; font-size: 1.8vh; color: #cdd6f4; background-color: #1e1e2e; } a { color: #f5c2e7; } a:hover { color: #cdd6f4; }
